import React from 'react'
import TimeStamp from './TimeStamp';
import Views from './Views';
import Button from './Button';
import UserImage from './UserImage';
import CommentItem from './CommentItem';


function Test(props) {
    console.log("test props", props);
    const {comments} = props.videoDetailsData;
    // console.log("test props",comments);
    const{name} = props.videoDetailsData.comments;
    console.log("test comments name",comments);
    return (
        <div>
            <h1 className="main-video__title">{props.videoDetailsData.title}</h1>
            <h2 className="main-video__name">By {props.videoDetailsData.channel}</h2>
            <TimeStamp className="main-video__date" timestamp={props.videoDetailsData.timestamp}/>
            <Views 
                classNameImg="main-video__viewsicon" 
                classNameP="main-video__viewscount"  
                views={props.views} 
                videoDetailsData={props.videoDetailsData}/>
            {/* <p className="comments__heading">{comments.length} Comments</p>    */}
            {/* <p className="comments__heading">{props.videoDetailsData.comments.length} Comments</p>                     */}
            <UserImage className="comments__userimage" user={props.user}/>
            <Button text="COMMENT" className="comments__formsubmit" />

            <ul id="commentlist" className= "commentlist"> 
                {props.videoDetailsData.comments.map ((comment) => (
                    <div key={comment.id} className="commentlist__container">
                        <CommentItem  
                        avatar={props.avatar}
                        id={comment.id}
                        name={comment.name}
                        comment={comment.comment}
                        timestamp={comment.timestamp}/>
                        <hr className="commentlist__divider"/>
                    </div>                        
                ))}                         
            </ul>       

        </div>
    )
}

export default Test


